import React from 'react'
import ReactDOM from 'react-dom'
import Link from 'next/link'

const linkStyle = {
    marginRight: 15
}

class NavBar extends React.Component {
    render() {
        return (
            <div>
                <Link href="/">
                    <a style={linkStyle}>Home</a>
                </Link>
                <Link href="/about">
                    <a style={linkStyle}>about</a>
                </Link>
            </div>
        )
    }
}

export default NavBar;
